import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css';
import UserManagement from './UserManagement'; // Import the UserManagement component

const Dashboard = () => {
    const [totalUsers, setTotalUsers] = useState(0);

    // Fetch total users from the API
    useEffect(() => {
        const fetchTotalUsers = async () => {
            try {
                const response = await axios.get('http://localhost:8080/users');
                // Assuming the response is an array of user objects
                const userCount = response.data.length;
                setTotalUsers(userCount);
            } catch (error) {
                console.error('Error fetching users:', error);
            }
        };

        fetchTotalUsers();
    }, []);

    return (
        <div className="dashboard">
            <div className="dashboard-header">
                <h1>Dashboard</h1>
            </div>
            <div className="dashboard-cards">
                <div className="card">
                    <h3>Total Users</h3>
                    <p>{totalUsers}</p>
                </div>
            </div>
            <UserManagement /> {/* Add the UserManagement component here */}
        </div>
    );
};

export default Dashboard;
